import React from "react";
import "./styles.css";
import SocialItems from "./SocialItems";

function Footer() {
  return <div style={{marginTop: window.innerHeight - 275}} className="Footer"><div
  className="SocialWrapper"
  // style={{
  //   visibility: this.state.isVisibile ? "hidden" : "visible",
  // }}
>
  <SocialItems
    className="Social"
    name="About"
    from={{ opacity: 0 }}
    to={{ opacity: 1 }}
    config={{ delay: 5000, duration: 500 }}
    url="https://www.linkedin.com/in/devanshi-bipin-ganatra/"
  ></SocialItems>
  <SocialItems
    className="Social"
    name="About"
    from={{ opacity: 0 }}
    to={{ opacity: 1 }}
    config={{ delay: 5300, duration: 500 }}
    bgColor="#d96a6a"
    url="mailto://devanshiganatra93@gmail.com"
  ></SocialItems>
  <SocialItems
    className="Social"
    name="About"
    from={{ opacity: 0 }}
    to={{ opacity: 1 }}
    config={{ delay: 5600, duration: 500 }}
    bgColor="#a169ff"
    url="https://www.instagram.com/art_dbg"
  ></SocialItems>
  <SocialItems
    className="Social"
    name="About"
    from={{ opacity: 0 }}
    to={{ opacity: 1 }}
    config={{ delay: 5900, duration: 500 }}
    url="https://www.facebook.com/devanshibipin.ganatra"
  ></SocialItems>
  <SocialItems
    className="Social"
    name="About"
    from={{ opacity: 0 }}
    to={{ opacity: 1 }}
    config={{ delay: 6200, duration: 500 }}
    bgColor="#655e5e"
    url="https://github.com/devanshiganatra93"
  ></SocialItems>
</div></div>;
}

export default Footer;
